import React from 'react';
import { Link } from 'react-router-dom';

const IndexPage = () => {
  return (
    <main>
      <div >
        <h1>Daniel Escobar</h1>
        <Link to={'/Curriculum'}>View Curriculum</Link>
      </div>
    </main>
  );
}

export{IndexPage};
